import React from 'react';

import {Container, Row} from '../BootstrapComponents/BootstrapComponents';
import Listing from './Listing/Listing';

import './Listings.scss';

const Listings = () => {
    return ( 
        <div className="listings bg-light">
            <Container>
                <Row>
                    <Col className="listing-results">
                        <p className="text-muted">0 listings in and around 91372</p>
                    </Col>
                </Row>
                <Row>
                    <Listing></Listing>
                </Row>
            </Container>
        </div>
     );
}

export default Listings;
